## CSS Stylesheets

This is the traditional way of styling web applications. You create a separate CSS file and import it into your component. This approach is straightforward and works well for small projects. However, as your project grows, managing CSS can become challenging due to global scope and potential class name conflicts.

```jsx
// App.css
.container {
  padding: 20px;
  background-color: #f0f0f0;
}

// App.js
import './App.css';

function App() {
  return <div className="container">Hello World</div>;
}
```

## Inline Styles

Inline styles allow you to write CSS directly in your JSX using JavaScript objects. This method is useful for dynamic styles based on component props or state. However, it lacks support for pseudo-classes, media queries, and keyframe animations.

```jsx
function App() {
  const styles = {
    padding: '20px',
    backgroundColor: '#f0f0f0',
  };

  return <div style={styles}>Hello World</div>;
}
```

